import * as React from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import { useFormik } from "formik";

export default function FormDialog() {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const formik = useFormik({
    initialValues: {
      fname: "",
      lname: "",
      homePhone: "",
      phone: "",
      streetNo: "",
      streetName: "",
      pincode: "",
      city: "",
      state: "",
      country: "",
    },
    onSubmit: (values) => {
      alert(JSON.stringify(values, null, 2));
    },
  });
  return (
    <div>
      <Button variant="outlined" onClick={handleClickOpen}>
        Add a User
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add Details</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Please enter your details here. We will send updates occasionally.
          </DialogContentText>
          <form onSubmit={formik.handleSubmit}>
            <TextField
              autoFocus
              margin="dense"
              label="First Name"
              variant="standard"
              required
              id="fname"
              name="fname"
              onChange={formik.handleChange}
              value={formik.values.fname}
            />
            <TextField
              autoFocus
              margin="dense"
              label="Last Name"
              variant="standard"
              id="lname"
              name="lname"
              onChange={formik.handleChange}
              value={formik.values.lname}
            />
            <TextField
              autoFocus
              margin="dense"
              label="Street Number"
              type="number"
              variant="standard"
              id="streetNo"
              name="streetNo"
              onChange={formik.handleChange}
              value={formik.values.streetNo}
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Street Name"
              variant="standard"
              id="streetNo"
              name="streetNo"
              onChange={formik.handleChange}
              value={formik.values.streetNo}
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="City"
              variant="standard"
              required
            />{" "}
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="State"
              variant="standard"
            />{" "}
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="PinCode"
              type={"number"}
              variant="standard"
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Country"
              required
              variant="standard"
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              type={"number"}
              label="Home Phone"
              variant="standard"
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              type={"number"}
              label="Phone number"
              required
              variant="standard"
            />{" "}
            <div className="form-buttons">
              <Button onClick={handleClose}>Cancel</Button>
              <Button type="submit">Submit</Button>{" "}
            </div>
          </form>
        </DialogContent>
      </Dialog>
    </div>
  );
}
